				main();
				return MathJax.startup.defaultPageReady();
			}

				tex: {
					inlineMath: [['$', '$'], ['\\(', '\\)']]
				},

					fontCache: 'global'

				startup: {
					pageReady: mathjax_ready_override
				}
			};
		</script>
		<script type="text/javascript" id="MathJax-script" async
								 src="https://cdn.jsdelivr.net/npm/mathjax@3/es5/tex-svg.js">
		</script>
